import { useState, useEffect } from 'react'
import Item from './Item'

export default function Items() {
  useEffect(()=>{
    getData()
  },[])
  const [data, setData] = useState([]);
  const getData=()=>{
    fetch('items.json').then(res => res.json()).then(data => setData(data))
  }

  return (
    <main>
      {data.map(el => (
        <Item item = {el} />
       // <h1 key = {el.id}>{el.title}</h1>
      ))}
    </main>
  )
}
